// FooterSection.js
import React from 'react';
import styles from './FooterSection.module.css';

// کامپوننت لوگوی Enamad
const EnamadBadge = () => (
  <div className={styles.badgeContainer}>
    <div className={styles.enamadLogo}></div>
    <div className={styles.badgeText}>
      <span className={styles.enamadText}>ENAMAD</span>
      <div className={styles.stars}>★★★★★</div>
      <span className={styles.subText}>نماد اعتماد الکترونیکی</span>
    </div>
  </div>
);

// کامپوننت لوگوی Samandehi
const SamandehiBadge = () => (
  <div className={styles.badgeContainer}>
    <div className={styles.samandehiLogo}></div>
    <div className={styles.badgeText}>
      <span className={styles.samandehiText}>SAMANDEHI.IR</span>
      <span className={styles.subText}>ثبت شده در ستاد ساماندهی</span>
    </div>
  </div>
);

// کامپوننت لوگوی اتحادیه کسب‌وکارهای مجازی
const VirtualBusinessUnionBadge = () => (
  <div className={styles.badgeContainer}>
    <div className={styles.virtualBusinessLogo}>
        <img />
    </div>
    <div className={styles.badgeText}>
      <span className={styles.subText}>عضو اتحادیه کشوری کسب و کارهای مجازی</span>
    </div>
  </div>
);

// کامپوننت بلوک متن
const FooterTextBlock = () => (
  <div className={styles.footerTextBlock}>
    <h2 className={styles.footerTitle}>دیجی کالا بیزینس: فوتر این سایت</h2>
    <p className={styles.footerDescription}>
      دیجی‌کالا به عنوان یکی از قدیمی‌ترین فروشگاه‌های اینترنتی با بیش از یک دهه تجربه، با پایبندی به سه اصل، پرداخت در محل، ۷ روز ضمانت بازگشت کالا و تضمین اصل‌بودن کالا موفق شده تا همگام با فروشگاه‌های معتبر جهان، به بزرگ‌ترین فروشگاه اینترنتی ایران تبدیل شود. به محض ورود به سایت دیجی‌کالا با دنیایی از کالا رو به رو می‌شوید! هر آنچه که نیاز دارید و به ذهن شما خطور می‌کند در اینجا پیدا خواهید کرد. این فروشگاه مثل یک ویترین پر زرق و برق است که با انواع و اقسام کالاهایی نظیر گوشی موبایل، ساعت هوشمند، تلویزیون، لپ‌تاپ و ... شما را به خود جذب می‌کند.
    </p>
    <a href="#" className={styles.seeMoreLink}>مشاهده بیشتر &gt;</a>
  </div>
);

// کامپوننت اصلی
const FooterSection = () => {
  return (
    <div className={styles.footerSection}>
      <div className={styles.certificationsWrapper}>
        <EnamadBadge />
        <SamandehiBadge />
        <VirtualBusinessUnionBadge />
      </div>
      <FooterTextBlock />
    </div>
  );
};

export default FooterSection;
